export default function CalendarBlock ( { items } ) {

    const renderedexpList = expList.map((exp) => {
        return(
            <div key={exp.heading} className="expList__lists">
                <h3>{exp.heading}</h3>
                <p>{exp.caption}</p>
                <div className="flex">
                    <div className="calendar flex flex-col">
                        <span>{exp.enddate}</span>
                        <span>{exp.startdate}</span>
                    </div>
                    <div className="expList__desc">
                        {exp.info}
                    </div>
                </div>
            </div>
        )
    });

    return (
        <>
        {renderedexpList}
        </>
    )
}
